var buildStatus = {};

// Convenience method to retrieve the popup view, if available
function getPopupView () {
	var views = chrome.extension.getViews();
	for (var i = 0; i < views.length; i ++) {
		if (views[i].location.href.indexOf("popup.html") > 0) {
			return views[i];
		}
	}
	
	return null;
}

// Retrieve the server build status
function getBuildStatus (url) {
		if (url === undefined) {
			url = localStorage.url + JENKINS_URL_SUFFIX;
		}
    chrome.browserAction.setBadgeText({text: ""});
		var popupView = getPopupView(); 
		$.ajax({
			type: "GET",
			url: url,
			dataType: "json",
			success: function (rspJson, status, xhr) {
				json = rspJson;

        buildStatus.date = new Date();
        buildStatus.json = json;
        updateBrowserActionUI(summarise(json));

				if (popupView !== null) {
					popupView.outputBuildStatus(buildStatus);
				}
				console.log("background.js: Got status, time = " + new Date().toLocaleTimeString());
			},
			error: function (xhr, errorType, error) {
				console.log(error);
				popupView.outputServerError();
			}
		});
}

function getJson () {
    return json;
}

function getStatus () {
    return buildStatus;
}

// Build summary of current build status
// TODO - nicer way of doing this?
function summarise (json) {
   var summary = {
        failed: 0,
        inProgress: 0,
        aborted: 0,
        unstable: 0,
        success: 0
    };
    $.each(json.jobs, function(i, job) {
        if (job.color === "red") {
            summary.failed ++;
        } else if (job.color ==="red_anime") {
            summary.inProgress ++;
        } else if (job.color ==="grey") {
            summary.aborted ++;
        } else if (job.color ==="yellow") {
            summary.unstable ++;
        } else if (job.color ==="blue") {
            summary.success ++;
        }
    });

    return summary;
}

// Update the browser action badge and tooltip based on the
// build summary info
function updateBrowserActionUI (summary) {
    if (summary.failed > 0) {
        chrome.browserAction.setBadgeText({ 
            text: summary.failed.toString()
        });
        chrome.browserAction.setBadgeBackgroundColor(BADGE_BACKGROUND_COLOR);
    }
}

// Respond to storage event changes
$(window).on("storage", function (e) {
    if (e.key === "pollInterval") {
        if (x !== undefined) {
            clearInterval(x);
        }
        x = setInterval(getBuildStatus, parseInt(localStorage.pollInterval, 10));
    }
});

// Get status on startup
if (localStorage.url !== undefined) {
    getBuildStatus();
}

// Kick off timer if we have a poll interval defined
if (localStorage.pollInterval !== undefined) {
    x = setInterval(getBuildStatus, parseInt(localStorage.pollInterval, 10));
}
